response.about:
* Визажист; 
* Основатель и преподаватель школы макияжа Светланы Визнюк, г.Днепропетровск;
* Мастер категории "международного класса"; 
* Член сборной Украины по визажу;
* Золотой призёр чемпионата мира "Hairdressing World Championship" by OMC 2012 в номинации "Свадебный макияж"   Италия, г. Милан;
* Призер чемпионата Европы по визажу 2012 
  (4 место в номинации "Подиумный макияж"), 
  Россия, г. Санкт-Петербург;
* Участник чемпионата мира по визажу "Hairdressing World Championship" by OMC 2011,
   Италия, г. Милан;
* Чемпионка Украины 2011 года (1 Место) в     номинации "Подиумный Макияж";
* Победитель конкурса Молодые таланты Украины   2009 года (1 место) в номинации "Свадебный макияж".
